/** @format */

import React from "react";
import { Link } from "react-router-dom";

const ImageCardList = (data) => {
  console.log(data.name);
  return (
    <div>
      <Link to={`/$data.id`}>
        <img src={data.image} />
        <h2>{data.name}</h2>
      </Link>
    </div>
  );
};
export default ImageCardList;
